    async enocontrarPessoasProximas(lat, long) {
        let proximas: any[] = [];
        let coord = { lat: lat, long: long };
        let distancia;
        await this.pessoas.forEach(x => {
            if (proximas.length < 3) {
                distancia = this.calc(coord.lat, coord.long, x.latitude, x.longitude);
                proximas.push({ KM: distancia, data: x });
            } else {
                for (let next of proximas) {
                    distancia = this.calc(coord.lat, coord.long, x.latitude, x.longitude);
                    if (parseFloat(distancia) < parseFloat(next.KM)) {
                        proximas.push({ KM: distancia, data: x });
                        break;
                    }
                }
            }
            if (proximas.length > 3) {
                proximas = proximas.sort(this.sortfunction);
                proximas.pop();
            }
        })
        proximas = proximas.sort(this.sortfunction);
        return proximas;
    }
    sortfunction(a, b) {
        return (a.KM - b.KM)
    }

    calc(lat1, lon1, lat2, lon2) {
        let response = 6371
        let respLat = (lat2 - lat1) * (Math.PI / 180)
        let respLong = (lon2 - lon1) * (Math.PI / 180)

        let a = Math.sin(respLat / 2) * Math.sin(respLat / 2) + Math.cos(lat1 * (Math.PI / 180)) * Math.cos(lat2 * (Math.PI / 180)) * Math.sin(respLong / 2) * Math.sin(respLong / 2)
        let c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a))
        let d = response * c

        return d.toFixed(2);
    }

